$_MODULE['<{cloudcache}prestashop>content2_38d9b91c515b7d3a97f2bf6e72cd24ec'] = 'Diese Modul ermöglicht Ihnen, Ihren PrestaShop über das CloudCache Content Delivery Network zu beschleunigen.';
$_MODULE['<{cloudcache}prestashop>content2_03894b6f1d0447b352ae5093b25beb3d'] = 'Das Content Delivery Network (CDN) ist für jeden Seitenbesitzer, der hohe Leistung und ein optimales Besuchererlebnis wünscht.';
$_MODULE['<{cloudcache}prestashop>content2_0bcf4cd42f3d29472055668091d3ebc6'] = 'CloudCache Kompatibilitätscheck';
$_MODULE['<{cloudcache}prestashop>content2_d83cbcd4f991b9b43098437b58a7d1f3'] = 'Warum CloudCache';
$_MODULE['<{cloudcache}prestashop>content2_6a26f548831e6a8c26bfbbd9f6ec61e0'] = 'Hilfe';
$_MODULE['<{cloudcache}prestashop>content2_f4f70727dc34561dfde1a3c529b6205c'] = 'Einstellungen';
$_MODULE['<{cloudcache}prestashop>content2_dad1f8d794ee0dd7753fe75e73b78f31'] = 'Zonen';
$_MODULE['<{cloudcache}prestashop>content2_52b730e469f179c52956110ff7d1920f'] = 'CloudCache ist auf die effiziente und schnelle Lieferung Ihres Web Contents ausgerichtet. Von „schweren“ Objekten (wie Bildern, CSS und JavaScript) aus Ihrem PrestaShop bewahren wir Kopien in unseren weltweiten Datencentern auf und liefern diese Ihren Kunden über das nächstgelegende Datencenter. Hier kommen die vielen Vorteile einer schneller ladenden Internetseite:';
$_MODULE['<{cloudcache}prestashop>content2_3ce64c688b949bec0dcec57bbdf2e48f'] = 'Thrive During Traffic Spikes!';
$_MODULE['<{cloudcache}prestashop>content2_be2501ec16464402d9069fabeae68cd0'] = 'Sollten Sie über Nacht berühmt werden (z.B.: Erwähnung Ihres Shops im TV) können Ihre Verkäufe in die Höhe schnellen, aber Ihr Server nicht folgen. Dann helfen wir Ihnen!';
$_MODULE['<{cloudcache}prestashop>content2_867681a0d2b527c81f35f397e26d96dc'] = 'Custom SSL made Easy';
$_MODULE['<{cloudcache}prestashop>content2_aeebd43d3152b36de94e03808ad25957'] = 'Unsere SSL Acceleration laden bis zu 70% Ihrer Server CPU Power ab. Außerdem machen wir die SSL-Nutzung auf dem Cloud sehr einfach und günstig. Wir berechnen monatlich nur $24.95 pro Custom SSL Zone, inklusive SSL Zertifikat.';
$_MODULE['<{cloudcache}prestashop>content2_2ea70b7571baf4de04631283af3a3a4b'] = 'Bessere SEO-Rankings';
$_MODULE['<{cloudcache}prestashop>content2_6ad31549b6404d19697b28d718e2aa77'] = 'Google nutzt die Seitenschnelligkeit als wesentlichen Faktor für den Ranking-Algorithmus. Eine bessere Ladezeit führt zu besseren Rankings in den Suchergebnissen, das bedeutet mehr Verkehr und mehr Einnahmen für Ihre Seite.';
$_MODULE['<{cloudcache}prestashop>content2_5b40a55b46342c709ef61fe48a11572f'] = 'Erhöhen Sie Ihre Umwandlung';
$_MODULE['<{cloudcache}prestashop>content2_8a8d5433fef3fe8b8940e32698d97e9d'] = 'Amazon hat herausgefunden, dass eine Seite, die 100 Millisekunden länger lädt, 1% ihres Umsatzes einbüßt. Wir finden, das ist Grund genug, um die Seitenladezeit zu optimieren.';
